import React from 'react';

const Home = ({greeting}) => {
    return (
        <div class="container">
            <div class="row">
                <p class="center-align flow-text card-panel hoverable">{greeting}</p>
                <a class="btn-floating pulse center-align"><i class="material-icons">menu</i></a>
            </div>
        </div>
    )
}

export default Home;
